import React, { useContext, useEffect, useState } from "react";
import { Link } from "react-router-dom";
import axios from "axios";
import { contextData } from "./Context";

export const Label3img = () => {
  // const [data] = useContext(contextData);
  const [data, setData] = useState([]);
  useEffect(() => {
    async function fetchData() {
      await axios
        .get("http://localhost:8000/api/v1/data3/homed")
        .then((req, res) => {
          const response = res.data;
          setData(response);
          console.log("hii, data recieved here, label 3 img", response);
        })
        .catch(() => console.log("error"));
    }
    fetchData();
  }, []);
  // const last = data[data.length - 1];
  // const last = data[34];
  // console.log(last, data[34]);
  return (
    <div className="label3">
      {data
        .filter((last, index) => last[index] === last[data.length - 1])
        .map((last, index) => {
          return (
            <Link
              to={`/${last.category}/${last.id}`}
              className="link2"
              key={index}
            >
              <p>
                <h1>{last.title}</h1>
                <br />
                <span>
                  <b>{last.category}</b> / {last.date}
                </span>
              </p>
              <img src={last.image} alt="srcimage here" />
            </Link>
          );
        })}
    </div>
  );
};
